import React from 'react';
import Common from './Common';

class Contact extends React.Component{
    constructor(props){
        super(props);
        this.handleChange = this.handleChange.bind(this);
    };

    handleChange(e){
        alert(e.target.value);
    };

    handleSubmit(e){
        e.preventDefault();
    }

    render(){
        return (
            <>
            <div className="col-6">
                <form onSubmit={this.handleSubmit}>
                    <h6>
                        First Name : <input type="text" name="firstName" onChange={this.handleChange} />
                    </h6>

                    <h6>
                        Last Name : <input type="text" name="lastName" onChange={this.handleChange} />
                    </h6>
                    <h6>
                        Mobile : <input type="text" name="mobile" onChange={this.handleChange} />
                    </h6>
                </form>
            </div>

            <div className="col-6">
                <Common 
                    pageName="Contact Page" 
                    description="This is Contact page Welcome here you are at right place"
                />
            </div>
            </>
        );
    };
}

